import React from "react"
import Heading from '@iso/ui/Heading/Heading';
import { Element } from 'react-scroll';
import DescriptionWrapper,{HeadingDescription} from "../Description1/Description1.style";
const Description1= ()=>{
    return(
        <Element name="reviews" className="reviews">
            <DescriptionWrapper>
               <Heading content={`Reviews`}{...statusHeadingStyle}/>
            </DescriptionWrapper>
        </Element>
    );

};
Description1.propTypes = {
    statusHeadingStyle: PropTypes.object,
    filterHeadingStyle: PropTypes.object,
    ratingLabelStyle: PropTypes.object,
    ratingCountStyle: PropTypes.object,
  };
  
  Description1.defaultProps = {
    statusHeadingStyle: {
      color: '#2C2C2C',
      fontSize: ['17px', '20px', '25px'],
      mr: '10px',
    },
    filterHeadingStyle: {
      color: '#2C2C2C',
      fontSize: '15px',
      fontWeight: '700',
      lineHeight: '1.2',
      mb: '0.5em',
    },
    ratingLabelStyle: {
      fontSize: '13px',
      fontWeight: '400',
      color: '#2c2c2c',
      flex: '1',
    },
    ratingCountStyle: {
      fontSize: '13px',
      fontWeight: '400',
      color: '#2c2c2c',
      ml: '8px',
    },
  };
export default Description1;
